/*Table structure for table `bitacora_tipo` */

DROP TABLE IF EXISTS `bitacora_tipo`;

CREATE TABLE `bitacora_tipo` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `tipo` varchar(50) NOT NULL,
  KEY `id` (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8;

/*Data for the table `bitacora_tipo` */

insert  into `bitacora_tipo`(`id`,`tipo`) values (1,'Actualización tarjeta'),(2,'Actualización vehiculo'),(3,'Servicio'),(4,'Realizó abono'),(5,'Registro de tarjeta'),(6,'Registro de vehiculo'),(7,'Registro de usuario web'),(8,'Autorización Nip Correcta'),(9,'Autorización Nip Inorrecta'),(10,'Inicio de sesión');

/*Table structure for table `bombaestacion` */

DROP TABLE IF EXISTS `bombaestacion`;

CREATE TABLE `bombaestacion` (
  `folio` int(11) NOT NULL AUTO_INCREMENT,
  `folio_estacion` int(11) NOT NULL,
  `num_bomba` int(11) NOT NULL,
  `nombre` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`folio`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

/*Data for the table `bombaestacion` */

insert  into `bombaestacion`(`folio`,`folio_estacion`,`num_bomba`,`nombre`) values (1,1,1,'BOMBA 1 STA FE'),(2,1,2,'BOMBA 2 STA FE'),(3,1,3,'BOMBA 3 STA FE'),(4,1,4,'BOMBA 4 STA FE');

/*Table structure for table `cargos` */

DROP TABLE IF EXISTS `cargos`;

CREATE TABLE `cargos` (
  `folio` int(11) NOT NULL AUTO_INCREMENT,
  `idcliente` int(11) NOT NULL,
  `fecha` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `tarjeta` varchar(20) DEFAULT NULL,
  `importe` double NOT NULL,
  `producto` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`folio`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `cargos` */

/*Table structure for table `choferes` */

DROP TABLE IF EXISTS `choferes`;

CREATE TABLE `choferes` (
  `idchofer` int(11) NOT NULL AUTO_INCREMENT,
  `idcliente` int(11) DEFAULT NULL,
  `nombre` varchar(80) DEFAULT NULL,
  `choferactivo` int(1) NOT NULL,
  `idvehiculo` int(2) NOT NULL,
  `nip` varchar(4) DEFAULT 'SinN',
  PRIMARY KEY (`idchofer`),
  KEY `idcliente` (`idcliente`),
  CONSTRAINT `choferes_ibfk_1` FOREIGN KEY (`idcliente`) REFERENCES `clientes` (`idcliente`)
