/* Trigger structure for table `abonos` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `bitacora_abono` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'jkmpg7ol_sistemas'@'187.190.91.255' */ /*!50003 TRIGGER `bitacora_abono` AFTER INSERT ON `abonos` FOR EACH ROW BEGIN
    INSERT INTO bitacora (fecha, tipo, idcliente, descripcion) values(new.fecha, "4", new.IDclienteAbono, NEW.importeabono);
  END */$$


DELIMITER ;

/* Trigger structure for table `servicios` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `bitacora_servicio` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'jkmpg7ol_sistemas'@'187.172.175.105' */ /*!50003 TRIGGER `bitacora_servicio` AFTER INSERT ON `servicios` FOR EACH ROW INSERT INTO  bitacora(fecha, tipo, idcliente, descripcion)       
VALUES(NOW(), "3", new.idcliente, CONCAT("Se realizó un servicio: ", FORMAT(new.litros,2)," Litros de ",(SELECT nombre FROM productos where folio=new.producto)," Importe $",FORMAT(new.importe,2))) */$$


DELIMITER ;

/* Trigger structure for table `tarjetas` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `bitacora_tarjeta` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'jkmpg7ol_sistemas'@'187.172.19.4' */ /*!50003 TRIGGER `bitacora_tarjeta` AFTER UPDATE ON `tarjetas` FOR EACH ROW BEGIN
    INSERT INTO bitacora (fecha, tipo, idcliente, descripcion) values(CURRENT_TIMESTAMP, "1", new.idcliente, NEW.notarjeta);
  END */$$


DELIMITER ;

/* Trigger structure for table `vehiculos` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `bitacora_vehiculo_update` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'jkmpg7ol_sistemas'@'187.172.19.4' */ /*!50003 TRIGGER `bitacora_vehiculo_update` AFTER UPDATE ON `vehiculos` FOR EACH ROW BEGIN
    INSERT INTO bitacora (fecha, tipo, idcliente, descripcion) values(current_timestamp,"2",new.idcliente,new.idtarjeta);
  END */$$


